script:
return (function (elem) {
        return (function() {
      // element has a shadowRoot property
      if (this.shadowRoot) {
        return this.shadowRoot.querySelector('//a[@aria-label="Mens T-Shirts Shop Now"]')
      }
      // fall back to querying the element directly if not
      return this.querySelector('//a[@aria-label="Mens T-Shirts Shop Now"]')
    }).call(elem);
    }).apply(null, arguments)
